import ExpenseItem from "./ExpenseItem";
import './Expenses.css'

function Expenses(props) {
  return (
    <div className="expenses">
      <ExpenseItem title={props.items[0].title} amout={props.items[0].amount} date={props.items[0].date} /> 
      <ExpenseItem title={props.items[1].title} amout={props.items[1].amount} date={props.items[1].date} /> 
      <ExpenseItem title={props.items[2].title} amout={props.items[2].amount} date={props.items[2].date} /> 
    </div>
  );
}

export default Expenses;
